" "use strict";

//expressionLogic
var rulesJSON = []
let parentCustomEventID = "aptrinsicInternalEventName"
var throttlingTimeInSeconds = 0
var sdkVersion = ""

var RuleEngineVersion = function version() {
  return "1.10.0"
}

function setRules(rules, throttling) {
    try {
        rulesJSON = rules
        if (typeof(rulesJSON) === "string") {
            rulesJSON = JSON.parse(rules)
        }
        throttlingTimeInSeconds = throttling
        return true
    } catch (error) {
        consoleLog(error)
        return false
    }
}

function evaluate(event, history) {
    let eventJSON = JSON.parse(event)
    if (!eventJSON) {
        RuleEngineFailureCallBack("ERROR Loading EVENT")
        return
    }
    if (eventJSON.type == "ENGAGEMENT" || eventJSON.type == "TAP") {
        RuleEngineSuccessCallBack([])
        return
    }
    if (!rulesJSON || rulesJSON.length == 0) {
        RuleEngineFailureCallBack("ERROR Loading RULES")
        return
    }

   if(eventJSON.libraryInfo && eventJSON.libraryInfo.version) {
       sdkVersion = eventJSON.libraryInfo.version
   }
   if (sdkVersion.length != 0 && isVersionGreater(sdkVersion, "1.4.1")) {
       if (!rulesJSON.engagements || rulesJSON.engagements.length == 0) {
           RuleEngineFailureCallBack("ERROR Loading Engagements")
           return
       }
   }else if (!rulesJSON.engagements || rulesJSON.engagements.length == 0) {
       RuleEngineSuccessCallBack([])
       return
   }


    try {
        var eventJSONCopy = {"type": eventJSON.type, "version":eventJSON.appInfo.version, "payload":eventJSON.payload, "sessionId": eventJSON.sessionId, "platform": eventJSON.osInfo.type}
        eventJSON = eventJSONCopy
    } catch (error){

    }
    try {
        var engagementHistory = JSON.parse(history)
        var engagements = []
        for (const engagement of rulesJSON.engagements) {
            var rules = engagement.engagementPayload.rules
            if (typeof(rules) === "string") {
                rules = JSON.parse(rules)
            }
            if (shouldProcessEngagement(eventJSON, engagement, engagementHistory) == false) {
                continue
            }
            for (const ruleElement of rules.ruleSets) {
                var result = false
                if (ruleElement.id == 'customEvents' && eventJSON.type == "CUSTOM") {
                    result = evaluateCustomEventRuleForEvent(ruleElement, eventJSON)
                } else if (ruleElement.id != 'customEvents' && ruleElement.id != 'applicationEvents') {
                    result = evaluateRuleForEvent(ruleElement.rules, '', eventJSON)
                } else if (ruleElement.id == 'applicationEvents') {
                    result = evaluateRuleForApplicationEvent(ruleElement.rules, '', eventJSON)
                }
                ruleElement["result"] = result
                if (result == true) {
                    break
                }
            }
            let validElements =  rules.ruleSets.filter(obj => {
                return obj.result == true
            })
            if (validElements.length > 0) {
                engagements.push(engagement)
            }
        }

        RuleEngineSuccessCallBack(filterEngagementOnPriority(engagements))
    } catch (error) {
        RuleEngineFailureCallBack(error.message)
    }
}

function filterEngagementOnPriority(engagements) {

   try {
       let filteredEngagements = engagements.filter(element => {return element.engagementPayload.engagementPriority !== null})
       if(filteredEngagements.length > 0){
           if (filteredEngagements.length == 1) {
               return filteredEngagements
           }
           //If they are in the same group - the one with the higher rank (lower number) wins
           let engagementsBasedOnPriority = filteredEngagements.sort(function(a, b) {
               return a.engagementPayload.engagementPriority.priorityGroup.priority - b.engagementPayload.engagementPriority.priorityGroup.priority
           })
           let topPriorityEngagement = engagementsBasedOnPriority[0]

           let topRankedEngagementPriorityId = topPriorityEngagement.engagementPayload.engagementPriority.priorityGroup.id
           //Fetch the same priority id engagements
           let topPrioritySameGroupEngagements = filteredEngagements.filter(element => {
               return element.engagementPayload.engagementPriority.priorityGroup.id == topRankedEngagementPriorityId
           })

           if(topPrioritySameGroupEngagements.length > 1) {
               //TODO: Should also check if the priorityGroup !== null
               let topRankSamePriorityEngagements = topPrioritySameGroupEngagements.sort(function(a, b) {
                   return a.engagementPayload.engagementPriority.rank - b.engagementPayload.engagementPriority.rank
               })
               return topRankSamePriorityEngagements
           }else {
               return topPrioritySameGroupEngagements
           }
       } else {
           return engagements
       }
   } catch (error) {
       return engagements
   }

}

function shouldProcessEngagement(eventJSON, engagement, engagementHistory) {
    //within ttl(timseToLeave) && qualificationScope && throtteling
    let currentTimeStamp = new Date()
    let payload = engagement.engagementPayload
    let engID = payload.engagementId
    let shouldLeave = (engagement.rTS + (engagement.ttl * 1000)) <= currentTimeStamp.getTime()
    if (shouldLeave) {
        return false
    }
    let currentSessionID = eventJSON.sessionId
    if (engagement.engagementPayload.qualificationScope.type === QualificationScope.STICKY) {
      return true
    } else if (engagement.engagementPayload.qualificationScope.type === QualificationScope.ONLYONCE) {
        let filteredEngagements = engagementHistory.filter(record => { return record.eId == engagement.engagementPayload.engagementId })
        if (filteredEngagements.length > 0) {
            return false
        }
    } else if (payload.qualificationScope.type === QualificationScope.REPEAT && isVersionGreater(sdkVersion, "1.9.0")) {
        return shouldShowRepeatedEngagement(engagement, engagementHistory);
    } else {
         //ONCE_PER_SESSION
        let filteredEngagements = engagementHistory.filter(record => { return record.sId == currentSessionID && record.eId == engID })
        if (filteredEngagements.length > 0) {
            return false
        }
    }
    if (payload.ignoreThrottling === true) {
        return true
    } else {
        let currentTimeStamp = new Date()
        let sortedHistory = engagementHistory.sort(function (a, b) { return b.timeStamp - a.timeStamp })
        if (sortedHistory.length > 0) {
            let isThrottling  = (sortedHistory[0].timeStamp) + (throttlingTimeInSeconds * 1000) < (currentTimeStamp.getTime())
            return isThrottling
        } else {
            return true
        }
    }
}

function isVersionGreater(a, b) {
    const result = a.localeCompare(b, undefined, { numeric: true, sensitivity: 'base' });
    return result >=0;
}

 function calculatedRepeatTimeInMS(repeatType) {
   switch(repeatType){
       case REPEAT_UNITS.MINUTES: return 60*1000
       case REPEAT_UNITS.HOURS: return 60*60*1000
       case REPEAT_UNITS.DAYS: return 24*60*60*1000
       case REPEAT_UNITS.WEEKS: return 7*24*60*60*1000
       case REPEAT_UNITS.MONTHS: return 30*24*60*60*1000
   }
 }

function shouldShowRepeatedEngagement(engagement, engHistory) {
    let payload = engagement.engagementPayload;
    let engID = payload.engagementId
    var qScope = payload.qualificationScope;
    var engType = payload.content.contentType;

    var history = engHistory.filter(obj => obj.eId == engID).sort((x, y) => { return x.timeStamp - y.timeStamp });
    var completedHistory = history.filter((obj) => (obj.metaData.trackingType == EngagementTrackingType.ENGAGEMENT_COMPLETED || obj.metaData.trackingType == EngagementTrackingType.SURVEY_RESPONSE));

    if (history.length == 0) return true;
    if (engType == EngagementContentType.IN_APP_DIALOG && qScope.maxTotalRecurrences != null && history.length == qScope.maxTotalRecurrences) {
        return false
    }
    var [shouldEndEng, shouldRepeat] = evaluateHistory(history, qScope);
    if (shouldEndEng == true) {
        return false
    } else {
        if (qScope.onComplete == INTERVAL_ON_COMPLETION.QUIT && completedHistory.length > 0) {
            return false;
        }
        let currentDateInMS = (new Date()).getTime();
        var historyLatestObj = history[history.length - 1];
        var timeDifference = currentDateInMS - historyLatestObj.timeStamp;
        if (engType == EngagementContentType.IN_APP_DIALOG || shouldRepeat == true) {//between groups
            return timeDifference > qScope.repeatValue * calculatedRepeatTimeInMS(qScope.repeatUnits);
        } else {//within group
            return timeDifference > qScope.minimumWaitBetweenAttemptsValue * calculatedRepeatTimeInMS(qScope.minimumWaitBetweenAttemptsUnit);
        }
    }
}

function evaluateHistory(history, qScope) {
    let groupArray = []
    var completedCount = 0
    history.forEach(element => {
        if (element.metaData.trackingType == EngagementTrackingType.ENGAGEMENT_VIEWED) {
            groupArray.push(element)
            if (groupArray.length == qScope.maxCrossSessionViews) {
                completedCount += 1;
                groupArray = [];
            }
        } else {
            completedCount += 1;
            groupArray = [];
        }
    });
    return [qScope.maxTotalRecurrences == null ? false : completedCount == qScope.maxTotalRecurrences, groupArray.length == 0];
}

 function removeSessionDuplicates(arr) {
   var unique = arr.reduce(function (acc, curr) {
       var similarObj = acc.filter(obj => obj.sId == curr.sId)
       if (similarObj.length == 0)
           acc.push(curr);
       return acc;
   }, []);
   return unique;
 }

 function evaluateRuleForApplicationEvent(rules, value, eventJSON) {
    if(rules.filter(obj => {return obj.value === "APP_OPENED"}).length != 0) {
       if(rules.filter(obj => {return obj.id === "fromBackground"}).length == 0){
           rules.push({"id":"fromBackground","operator":"equals","value":"false","condition":"and","ruleGroupIndex":0,"type":"boolean"})
       }
    }
    return evaluateRuleForEvent(rules, value, eventJSON)
}

function evaluateCustomEventRuleForEvent(ruleElement, eventJSON) {
    //get groupIndexes
    var rules = ruleElement.rules
    var groupIndexes = rules.map ( rule => { return rule.ruleGroupIndex })
    groupIndexes = [...new Set(groupIndexes)]

    //
    var result = false
    for (let index = 0; index < groupIndexes.length; index++) {
        var ruleElementIndex = ruleElement[index.toString()]
        if (ruleElementIndex != undefined && ruleElementIndex["aptrinsicInternalEventName"] == true) {
            continue
        }
        let groupIndex = groupIndexes[index]
        var group = rules.filter( obj => {
            return obj.ruleGroupIndex == groupIndex
        })
        let parent = group.filter ( obj => {
            return obj.id === parentCustomEventID
        })[0]
        let children = group.filter ( obj => {
            return obj.id !== parentCustomEventID &&
                                    obj.id !== "screenName" &&
                                    obj.id !== "screenClass" &&
                                    obj.id !== "platform"
        })
        let mainGroup = group.filter ( obj => {
            return obj.id == "screenName" || obj.id == "screenClass" || obj.id == "platform"
        })
        var groupResult = true
        if (mainGroup.length > 0 ) {
            groupResult = evaluateRuleForEvent(mainGroup, '', eventJSON)
        }
        if (groupResult == true ) {
            var parentCopy = Object.assign({}, parent)
            parentCopy.id = 'name';
            let parentResult = evaluateRuleForEvent([parentCopy], parentCopy.value, eventJSON)
            groupResult = parentResult
            if (parentResult == true && children != undefined && children.length > 0) {
                let childrenResult = evaluateRuleForEvent(children, '', eventJSON)
                groupResult = parentResult && childrenResult
            }
            result = groupResult
        }
    }
    return result
}

function evaluateRuleForEvent(rules, value, eventJSON) {
    var result = false
    let platformMatchedObj = rules.filter( obj => { return obj.id == "platform" })
    if (platformMatchedObj.length > 0 ) {
        if (platformMatchedObj[0].value.indexOf(eventJSON.platform) > -1 == false) {
            return false
        }
    }
    for (let ruleIndex = 0; ruleIndex < rules.length; ruleIndex++) {
        const rule = rules[ruleIndex];
        let operator = rule.type + "." + rule.operator
        let objects = getObjects(eventJSON, rule.id, value)
        if (objects == undefined || objects.length == 0) {
            result = false
        } else {
            for (const object of objects) {
                if (object == undefined) {
                    result = false
                } else {
                    var eventValue = object[rule.id]
                    let isDateRuleInBetween = (operator == operations.DATETIME.BETWEEN || operator == operations.DATETIME_WITH_SET.BETWEEN)
                    if (isDateRuleInBetween) {
                        result = evaluateOperation(operator, rule.value[0], rule.value[1], eventValue)
                    } else {
                        if (rule.value == null){
                            result = evaluateRuleValues(operator, eventValue, undefined)
                        } else {
                            var ruleValues = typeof(rule.value) == "object" ? rule.value : [rule.value]
                            result = evaluateRuleValues(operator, eventValue, ruleValues)
                        }
                    }
                }
                if(result == true) {
                    break
                }
            }
        }
        if (rule.condition == 'and' && result == false) {
            break;
        } else if(rule.condition == 'or' && result == true) {
            break;
        }
    }
    return result
}

function evaluateRuleValues(operator, lhs, ruleValues) {
    if (ruleValues == undefined) {
        return evaluateOperation(operator, lhs, undefined)
    }
    var result = false
    for (let ruleValueIndex = 0; ruleValueIndex < ruleValues.length; ruleValueIndex++) {
        let ruleValue = ruleValues[ruleValueIndex]
        result = evaluateOperation(operator, lhs, ruleValue)
        if (result == true) {
            break
        }
    }
    return result
}

//return an array of objects according to key, value, or key and value matching
function getObjects(obj, key, val) {
    var objects = [];
    for (var i in obj) {
        if (!obj.hasOwnProperty(i)) continue;
        if (typeof obj[i] == 'object') {
            objects = objects.concat(getObjects(obj[i], key, val));
        } else
        //if key matches and value matches or if key matches and value is not passed (eliminating the case where key matches but passed value does not)
        if (i == key && obj[i] == val || i == key && val == '') { //
            objects.push(obj);
        } else if (obj[i] == val && key == ''){
            //only add if the object is not already in the array
            if (objects.lastIndexOf(obj) == -1){
                objects.push(obj);
            }
        }
    }
    return objects;
}

const EngagementTrackingType = {
   ENGAGEMENT_VIEWED: 'ENGAGEMENT_VIEWED',
   ENGAGEMENT_COMPLETED: 'ENGAGEMENT_COMPLETED',
   SURVEY_RESPONSE: 'SURVEY_RESPONSE'
}

const EngagementContentType = {
   IN_APP_DIALOG: 'IN_APP_DIALOG',
   IN_APP_CAROUSEL: 'IN_APP_CAROUSEL',
   IN_APP_SURVEY_NPS: 'IN_APP_SURVEY_NPS',
   IN_APP_CES_SURVEY: 'IN_APP_CES_SURVEY',
   IN_APP_RATING_SURVEY: 'IN_APP_RATING_SURVEY',
   IN_APP_BOOLEAN_SURVEY: 'IN_APP_BOOLEAN_SURVEY',
   IN_APP_GUIDE: 'IN_APP_GUIDE'
}

const REPEAT_UNITS = {
   MINUTES: "MINUTES",
   HOURS: "HOURS",
   DAYS: "DAYS",
   WEEKS: "WEEKS",
   MONTHS: "MONTHS"
}

const INTERVAL_ON_COMPLETION = {
   WAIT_FOR_NEXT_RECURRENCE: "WAIT_FOR_NEXT_RECURRENCE",
   QUIT: "QUIT"
}

const QualificationScope = {
    ONLYONCE: 'ONCE',
    ONCEPERVISIT: 'ONCE_PER_SESSION',
    REPEAT: 'REPEAT',
    STICKY: 'STICKY'
}

const operations = {
    STRING: {
        EQUALS: "string.is",
        IS_NOT: "string.isNot",
        IS_EMPTY: "string.isEmpty",
        IS_NOT_EMPTY:"string.isNotEmpty",
        STARTSWITH: "string.startsWith",
        NOT_STARTSWITH:"string.notStartsWith",
        ENDSWITH: "string.endsWith",
        NOT_ENDSWITH: "string.notEndsWith",
        INCLUDES: "string.contains",
        NOT_INCLUDES: "string.notContains"
    },
    URLSTRING: {
        IS: "urlString.is",
        IS_NOT: "urlString.is not"
    },
    NAME_VALUE: {
        "is": "nameValue.is",
        "isNot": "nameValue.is not",
        "isEmpty": "nameValue.is empty",
        "isNotEmpty": "nameValue.is not empty",
        "startsWith": "nameValue.starts with",
        "notStartsWith": "nameValue.not starts with",
        "endsWith": "nameValue.ends with",
        "notEndsWith": "nameValue.not ends with",
        "contains": "nameValue.contains",
        "notContains": "nameValue.not contains"
    },
    NUMBER: {
        EQUALS: "number.equals",
        NOT_EQUALS: "number.notEquals",
        GREATER_THAN: "number.greaterThan",
        SMALLER_THAN: "number.smallerThan"
    },
    SINGLE_VALUE_SELECTOR: {
        "equals": "singleValueSelector.is",
        "notEquals": "singleValueSelector.is not"
    },
    POSITIVE_SINGLE_VALUE_SELECTOR_EQUALS: "positiveSingleValueSelector.equals",
    MULTI_VALUE_SELECTOR: {
        "in": "multiValueSelector.in",
        "notIn": "multiValueSelector.not in"
    },
    POSITIVE_MULTI_VALUE_SELECTOR_IN: "positiveMultiValueSelector.in",
    BOOLEAN: {
        IS: "boolean.is",
        EQUALS: "boolean.equals"
    },
    DATETIME: {
        ON: "datetime.on",
        BEFORE: "datetime.before",
        AFTER: "datetime.after",
        BETWEEN: "datetime.between",
        MORE_THAN: "datetime.moreThan",
        LESS_THAN: "datetime.lessThan",
        EXACTLY: "datetime.exactly"
    },
    RIGHT_NOW:  "rightNow.right now",
    NO_OPERATOR: "noOperator",
    EQUALS: "equals",
    STRING_WITH_SET: {
        EQUALS: "stringWithSet.is",
        IS_NOT: "stringWithSet.isNot",
        IS_EMPTY: "stringWithSet.isEmpty",
        IS_NOT_EMPTY:"stringWithSet.isNotEmpty",
        STARTSWITH: "stringWithSet.startsWith",
        NOT_STARTSWITH:"stringWithSet.notStartsWith",
        ENDSWITH: "stringWithSet.endsWith",
        NOT_ENDSWITH: "stringWithSet.notEndsWith",
        INCLUDES: "stringWithSet.contains",
        NOT_INCLUDES: "stringWithSet.notContains",
        IS_SET: "stringWithSet.is set",
        IS_NOT_SET: "stringWithSet.is not set"
        },
    NUMBER_WITH_SET: {
        EQUALS: "numberWithSet.is",
        NOT_EQUALS: "numberWithSet.is not",
        GREATER_THAN: "numberWithSet.greater than",
        SMALLER_THAN: "numberWithSet.less than" ,
        IS_SET: "numberWithSet.is set",
        IS_NOT_SET: "numberWithSet.is not set"
    },
    DATETIME_WITH_SET: {
        ON: "datetimeWithSet.on",
        BEFORE: "datetimeWithSet.before",
        AFTER: "datetimeWithSet.after",
        BETWEEN: "datetimeWithSet.between",
        MORE_THAN: "datetimeWithSet.more than",
        LESS_THAN: "datetimeWithSet.less than",
        EXACTLY: "datetimeWithSet.exactly",
        IS_SET: "datetimeWithSet.is set",
        IS_NOT_SET: "datetimeWithSet.is not set"
    },
    BOOLEAN_WITH_SET: {
        EQUALS: "booleanWithSet.is",
        IS_SET: "booleanWithSet.is set",
        IS_NOT_SET: "booleanWithSet.is not set"
    }
};

function evaluateOperation(operation, lhs, rhs, betweenDate) {
    if (lhs == undefined || operation == undefined) {
        return false
    }
    switch (operation) {
    //STRING
        case operations.STRING.EQUALS:
        case operations.EQUALS:
        case operations.STRING_WITH_SET.EQUALS:
        case operations.POSITIVE_SINGLE_VALUE_SELECTOR_EQUALS:
        case operations.NUMBER_WITH_SET.EQUALS:
        case operations.BOOLEAN.IS:
        case operations.BOOLEAN_WITH_SET.EQUALS:
        case operations.POSITIVE_MULTI_VALUE_SELECTOR_IN:
            return lhs === rhs
        case operations.NUMBER.EQUALS:
            return lhs == rhs
        case operations.BOOLEAN.EQUALS:
            return lhs === stringToBoolean(rhs)
        case operations.STRING.IS_NOT:
        case operations.STRING_WITH_SET.IS_NOT:
        case operations.NUMBER.NOT_EQUALS:
        case operations.NUMBER_WITH_SET.NOT_EQUALS:
            return lhs !== rhs
        case operations.STRING.IS_EMPTY:
        case operations.STRING_WITH_SET.IS_EMPTY:
            return isEmpty(lhs)
        case operations.STRING.IS_NOT_EMPTY:
        case operations.STRING_WITH_SET.IS_NOT_EMPTY:
            return !isEmpty(lhs)
        case operations.STRING.STARTSWITH:
        case operations.STRING_WITH_SET.STARTSWITH:
            return lhs.startsWith(rhs)
        case operations.STRING.NOT_STARTSWITH:
        case operations.STRING_WITH_SET.NOT_STARTSWITH:
            return !lhs.startsWith(rhs)
        case operations.STRING.ENDSWITH:
        case operations.STRING_WITH_SET.ENDSWITH:
            return lhs.endsWith(rhs)
        case operations.STRING.NOT_ENDSWITH:
        case operations.STRING_WITH_SET.NOT_ENDSWITH:
            return !lhs.endsWith(rhs)
        case operations.STRING.INCLUDES:
        case operations.STRING_WITH_SET.INCLUDES:
            return lhs.includes(rhs)
        case operations.STRING.NOT_INCLUDES:
        case operations.STRING_WITH_SET.NOT_INCLUDES:
            return !lhs.includes(rhs)
    //DATETIME
        case operations.DATETIME.ON:
        case operations.DATETIME_WITH_SET.ON:
            return dates.isSameDay(lhs, rhs)
        case operations.DATETIME.BEFORE:
        case operations.DATETIME_WITH_SET.BEFORE:
            return dates.before(lhs, rhs)
        case operations.DATETIME.AFTER:
        case operations.DATETIME_WITH_SET.AFTER:
            return dates.after(lhs, rhs)
        case operations.DATETIME.BETWEEN:
        case operations.DATETIME_WITH_SET.BETWEEN:
            return dates.inRange(betweenDate, lhs, rhs)
        case operations.DATETIME.MORE_THAN:
        case operations.DATETIME_WITH_SET.MORE_THAN:
            {
                let days = Number(rhs)
                let givenTimeStamp = dates.convert(lhs).getTime()
                if (days == NaN && givenTimeStamp !== undefined) {
                    return false
                }
                let todayTimeStamp = new Date().getTime()
                var timestamp = givenTimeStamp + (days * 24 * 60 * 60 * 1000)
                return todayTimeStamp > timestamp
            }
        case operations.DATETIME.LESS_THAN:
        case operations.DATETIME_WITH_SET.LESS_THAN:
            {
                let days = Number(rhs)
                let givenTimeStamp = dates.convert(lhs).getTime()
                if (days == NaN && givenTimeStamp !== undefined) {
                return false
                }
                let todayTimeStamp = new Date().getTime()
                var timestamp = givenTimeStamp + (days * 24 * 60 * 60 * 1000)
                return todayTimeStamp < timestamp
            }
        case operations.DATETIME.EXACTLY:
        case operations.DATETIME_WITH_SET.EXACTLY:
            let equalDays = daysDifference(new Date(), lhs)
            return equalDays == rhs
    //NUMBER
        case operations.NUMBER.GREATER_THAN:
        case operations.NUMBER_WITH_SET.GREATER_THAN:
            let gNumberLHS = Number(lhs)
            let gNumberRHS = Number(rhs)
            if (gNumberLHS != NaN && gNumberRHS != NaN) {
                return gNumberLHS > gNumberRHS
            }
            return false
        case operations.NUMBER.SMALLER_THAN:
        case operations.NUMBER_WITH_SET.LESS_THAN:
        let numberLHS = Number(lhs)
        let numberRHS = Number(rhs)
        if (numberLHS != NaN && numberRHS != NaN) {
            return numberLHS < numberRHS
        }
        return false
    default:
        break;
    }
}

//MARK: extended functions

function daysDifference(fromDate, toDate) {
    return Math.floor((dates.convert(fromDate) - dates.convert(toDate))/(1000*60*60*24))
}

function isEmpty(str) {
    return (!str || 0 === str.length);
}

function stringToBoolean(string){
    switch(string.toLowerCase().trim()){
        case "true": case "yes": case "1": return true;
        case "false": case "no": case "0": case null: return false;
        default: return Boolean(string);
    }
}

var dates = {
    convert:function(d) {
        // Converts the date in d to a date-object. The input can be:
        //   a date object: returned without modification
        //  an array      : Interpreted as [year,month,day]. NOTE: month is 0-11.
        //   a number     : Interpreted as number of milliseconds
        //                  since 1 Jan 1970 (a timestamp)
        //   a string     : Any format supported by the javascript engine, like
        //                  "YYYY/MM/DD", "MM/DD/YYYY", "Jan 31 2009" etc.
        //  an object     : Interpreted as an object with year, month and date
        //                  attributes.  **NOTE** month is 0-11.
        return (
            d.constructor === Date ? d :
            d.constructor === Array ? new Date(d[0],d[1],d[2]) :
            d.constructor === Number ? new Date(d) :
            d.constructor === String ? new Date(d) :
            typeof d === "object" ? new Date(d.year,d.month,d.date) :
            false
        );
    },
    compare:function(a,b) {
        // Compare two dates (could be of any type supported by the convert
        // function above) and returns:
        //  -1 : if a < b
        //   0 : if a = b
        //   1 : if a > b
        // false : if a or b is an illegal date
        // NOTE: The code inside isFinite does an assignment (=).
        return (
            isFinite(a=this.convert(a).valueOf()) &&
            isFinite(b=this.convert(b).valueOf()) ?
            (a>b)-(a<b) :
            false
        );
    },
    inRange:function(d,start,end) {
        // Checks if date in d is between dates in start and end.
        // Returns a boolean or NaN:
        //    true  : if d is between start and end (inclusive)
        //    false : if d is before start or after end or if one or more of the dates is illegal.
        // NOTE: The code inside isFinite does an assignment (=).
        return (
            isFinite(d=this.convert(d).valueOf()) &&
            isFinite(start=this.convert(start).valueOf()) &&
            isFinite(end=this.convert(end).valueOf()) ?
            start <= d && d <= end :
            false
        );
    },
    before: function(a, b) {
        //Checks if a is before b
        // Returns a boolean or NaN:
        //  true  : if today is before date
        //  false : if today is not before date or if one or more of the dates is illegal.
        //  NOTES : The code inside isFinite does an assignment (=).
        return (
            isFinite(a=this.convert(a)) &&
            isFinite(b=this.convert(b)) ?
            a.getYear() < b.getYear() ?
            true :
            a.getYear() == b.getYear() ?
            a.getMonth() <= b.getMonth() ?
            a.getMonth() == b.getMonth() ?
            a.getDate() < b.getDate() :
            true :
            false :
            false :
            false
        );
    },
    isSameDay: function(a, b) {
        //Checks if date is today
        //Return a boolean or NaN
        //  true  : if today is date
        //  false : if today is not date or if one or more of the dates is illegal.
        //  NOTES : The code inside isFinite does an assignment (=).
        return (
            isFinite(a=this.convert(a)) &&
            isFinite(b=this.convert(b)) ?
            a.getYear() == b.getYear() &&
            a.getMonth() == b.getMonth() &&
            a.getDate() == b.getDate() :
            false
        );
    },
    after: function(a, b) {
        //Checks if a is after b
        // Returns a boolean or NaN:
        //  true  : if today is after date
        //  false : if today is not after date
        //  NOTES : The code inside isFinite does an assignment (=).
        return this.isSameDay(a, b) == false && this.before(a, b) == false
    }
}"
